import React from 'react';
import { connect } from 'react-redux';

import GlobalStyle from './utils/globalStyles';
import Routes from './routing';
import Header from './components/Header';

const App = () => {
	return (
		<div>
			<GlobalStyle />
			<Header />
			<Routes />
		</div>
	);
};

export default connect()(App);
